{
// console.log("This is function")
const apiData=await axios.get('http://localhost:8000/api/admin-dash');
// console.get(apidata.data);
setData(apiData.data);
  
};

useEffect(()=>{
  func();
},[]);


  return(
    
      

    
        <div class="row">
